6-08T09:24:52.822389","status":"completed"},"tags":[]},"source":["   hp        wt         disp       qsec \n","   \n","   \n"," 5.166758   6.916942    7.985439   3.133119\n"," \n"," \n","* The we can see that MC exist as hp,wt,disp have vif >5 which means they are correlated\n","* In some cases it is relaxed upto 10.\n","* So here we can go ahead and drop the variable with highest vif but we are going to keep it."]},{"cell_type":"markdown","id":"407d722a","metadata":{"papermill":{"duration":0.02386,"end_time":"2022-06-08T09:24:52.893094","exception":false,"start_time":"2022-06-08T09:24:52.869234","status":"completed"},"tags":[]},"source":["# Assumption 5: Assumption of Constant Variance / Homoscadasticity\n","\n","\n","* Constant Variance is also known as Homoscodasticity. In the context we presume that variance of error term is cosntant all over observation.If assumption is violated the situation is called heteroscadasticitypfuncation fo fitted value\n","* it makes it diffeicult to meausure the true standard deviation of the forecast errors , leading to confidence intervals that are too wide or too narrow\n","* Homoscadasticiy may also have affect of given too much weight to small subset of the data(namely the subset where the error was large) when esimating coefficeints\n","1. Residual vs predict value .\n","1. Residual vs independent variables here also the error should not increase or decrease consistently\n","1. statistical test for Homoscadasticity\n","\n","\n","install.packages(\"lmtest\")\n","\n","\n","* Levenes test\n","* Breush-pagan\n","* barletts test\n","* f-test for two sample sample test\n","\n"]},{"cell_type":"code","execution_count":17,"id":"3c8dd2c7","metadata":{"execution":{"iopub.execute_input":"2022-06-08T09:24:52.948842Z","iopub.status.busy":"2022-06-08T09:24:52.943086Z","iopub.status.idle":"2022-06-08T09:24:53.408128Z","shell.execute_reply":"2022-06-08T09:24:53.406261Z"},"papermill":{"duration":0.493255,"end_time":"2022-06-08T09:24:53.410639",